这些属性用在 use 声明语句，和控制文档出现的位置。例如，考虑这个 Rust 代码： pub use bar::Bar; /// bar docs
pub mod bar { /// the docs for Bar pub struct Bar;
} 该文档将生成“Re-exports”部分，并给出 pub use bar::Bar; ，那这个 Bar 会是它自身页面的链接。 但如果我们像这样，改变了 use 行： #[doc(inline)]
pub use bar::Bar; Bar 就变成，出现在 Structs 部分， Bar 就像是在顶层定义的，而不是 pub use 形式。 让我们改变我们原来的例子，把 bar 模块变为私有： pub use bar::Bar; /// bar docs
mod bar { /// the docs for Bar pub struct Bar;
} 在这里，因为 bar 不公开， Bar 就不会有自己的页面，所以没有地方可以链接。 rustdoc 将内联(inline)这些定义，因此我们最终的结果与上面 #[doc(inline)] 一样； Bar 在 Structs 部分，好像它是在顶层定义的。如果，我们换成 no_inline ： #[doc(no_inline)]
pub use bar::Bar; /// bar docs
mod bar { /// the docs for Bar pub struct Bar;
} 现在变成，有一个 Re-exports 部分，但 Bar 不会链接到任何地方。 一个特例：在 Rust 2018 及以后，如果你 pub use 你的一个依赖，除非你添加 #[doc(inline)] ，否则 rustdoc 不会急切地将其作为模块内联。

