rustdoc 支持执行文档示例，作为测试。这可以确保您的测试是最新的和有效的。 基本的想法是这样的： /// # Examples
///
/// ```
/// let x = 5;
/// ``` 三个反引号开始和结束的代码块。如果这是在一个名为 foo.rs 的文件中，运行 rustdoc --test foo.rs 将提取此示例，然后将其作为测试运行。 请注意，默认情况下，如果没有为代码块设置语言， rustdoc 假设它是 Rust 码。所以，以下内容： ```rust
let x = 5;
``` 严格等同于： ```
let x = 5;
``` 虽然有些微妙！但请继续。

