有时，您需要一些设置代码，或其他会分散您示例，但对有效测试非常重要的的内容。考虑一个如下所示的示例块： /// /// Some documentation.
/// # fn foo() {} // this function will be hidden
/// println!("Hello, World!"); 它将呈现如下： /// Some documentation.
# fn foo() {}
println!("Hello, World!"); 是的，这是正确的：你可以添加以 # 开头的行，它们将从输出中隐藏，但在编译代码时将被使用。你可以利用这个优势。设想下，当文档注释需要应用于某种函数，所以如果我只想向您展示文档注释，我需要在它下面添加一个小函数定义。同时，它只是满足编译器，所以隐藏它，会使示例更清晰。您可以使用此技术，详细解释更长的示例，同时仍保留文档的可测试性。 例如，假设我们想要文档化此代码： let x = 5;
let y = 6;
println!("{}", x + y); 我们可能希望文档最终看起来像这样： 首先，我们设定 x 到 5： let x = 5;
# let y = 6;
# println!("{}", x + y); 接下来，我们设置 y 到 6： # let x = 5;
let y = 6;
# println!("{}", x + y); 最后，我们打印出的总和 x 和 y ： # let x = 5;
# let y = 6;
println!("{}", x + y); 为了保持每个代码块可测试，我们希望每个块，都有整个程序，但我们不希望读者每次都看到每一行。这是我们在源代码中添加的内容： First, we set `x` to five: ```
let x = 5;
# let y = 6;
# println!("{}", x + y);
``` Next, we set `y` to six: ```
# let x = 5;
let y = 6;
# println!("{}", x + y);
``` Finally, we print the sum of `x` and `y`: ```
# let x = 5;
# let y = 6;
println!("{}", x + y);
``` 通过重复示例的所有部分，您可以确保您的示例仍然编译，同时仅显示与您的解释部分相关的部分。 通过使用两个连续的 ## 哈希值，可以防止隐藏。这只需要用第一个完成 # 否则会导致隐藏。如果我们有一个像下面这样的字符串文字，它有一行是以一个 # 开头的字符串： let s = "foo
## bar # baz"; 我们可以通过转义头个 # 来文档化它： /// let s = "foo
/// ## bar # baz";

