在编写示例时，包含完整的错误处理很少有用，因为它会添加大量的样板代码。相反，您可能需要以下内容： /// ```
/// use std::io;
/// let mut input = String::new();
/// io::stdin().read_line(&mut input)?;
/// ``` 问题是， ? 会返回一个 Result<T, E> ，而测试函数是不返回任何内容，因此这会给出不匹配的类型错误。 你可以通过手动添加一个 main ，它返回 Result<T, E> ，因为 Result<T, E> 实现 Termination trait，自然解决了这个限制： /// A doc test using ?
///
/// ```
/// use std::io;
///
/// fn main() -> io::Result<()> {
/// let mut input = String::new();
/// io::stdin().read_line(&mut input)?;
/// Ok(())
/// }
/// ``` 再加上从上面的 # 部分，您可以得出一个解决方案，在读者看来它就是最初的想法，但可以与文档测试一起使用： /// ```
/// use std::io;
/// # fn main() -> io::Result<()> {
/// let mut input = String::new();
/// io::stdin().read_line(&mut input)?;
/// # Ok(())
/// # }
/// ``` 从 1.34.0 版开始，还可以省略 fn main() ，但必须消除错误类型的歧义： /// ```
/// use std::io;
/// let mut input = String::new();
/// io::stdin().read_line(&mut input)?;
/// # Ok::<(), io::Error>(())
/// ``` ? 运算符要添加隐式转换，是一个不幸的结果。是因为类型不是唯一的，所以不这样的话，会导致类型推断失败。请注意，您必须写下 (()) 序列，中间没有空格，以便 RustDoc 了解您需要一个隐式 Result ——返回函数。 从 1.37.0 版开始，这种简化也适用于 Option s，可以方便地测试，例如迭代器或校验算术，例如： /// ```
/// let _ = &[].iter().next()?;
///# Some(())
/// ``` 请注意，结果必须是 Some(()) ，且必须一次。在这种情况下，不需要消除结果的歧义。

