以下是一个宏的文档示例： /// 除非表达式正确，不然就信息性恐慌
///
/// # Examples
///
/// ```
/// # #[macro_use] extern crate foo;
/// # fn main() {
/// panic_unless!(1 + 1 == 2, “Math is broken.”);
/// # }
/// ```
///
/// ```should_panic
/// # #[macro_use] extern crate foo;
/// # fn main() {
/// panic_unless!(true == false, “I’m broken.”);
/// # }
/// ```
#[macro_export]
macro_rules! panic_unless { ($condition:expr, $($rest:expr),+) => ({ if ! $condition { panic!($($rest),+); } });
}
# fn main() {} 你会注意到三件事： 1，我们需要增加我们自己的 extern crate 行，以便我们可以添加 #[macro_use] 属性。 2，我们需要增加我们自己的 main() 以及（出于上述原因）。 3，最后，明智地使用 # 注释掉这两件事，这样它们就不会出现在输出中。

