有一些注释对 rustdoc 正确测试代码的事情上有帮助： /// ```ignore
/// fn foo() {
/// ```
# fn foo() {} 这个 ignore 指令告诉 Rust 忽略您的代码。大概是你不想要的(代码)，因为它太普通了。相反，如果不是代码，考虑用 text 文本，或者使用 # 得到一个只显示你关心的部分的工作示例。 /// ```should_panic
/// assert!(false);
/// ```
# fn foo() {} should_panic 讲述 rustdoc 代码应该正确编译，但不能作为测试通过。 /// ```no_run
/// loop {
/// println!("Hello, world");
/// }
/// ```
# fn foo() {} 这个 no_run 属性将编译代码，但不运行它。这对“以下是如何检索网页”等示例很重要，您可能希望确保编译，但可能是在没有网络访问的测试环境中运行。 /// ```compile_fail
/// let x = 5;
/// x += 2; // shouldn't compile!
/// ``` compile_fail 讲述 rustdoc 编译应该失败。如果它编译，那么测试将失败。但是，请注意，随着新特性的添加，在当前 Rust 标准版失败的代码，可能在将来的版本中工作。 /// 只在 2018 edition 运行.
///
/// ```edition2018
/// let result: Result<i32, ParseIntError> = try {
/// "1".parse::<i32>()?
/// + "2".parse::<i32>()?
/// + "3".parse::<i32>()?
/// };
/// ``` edition2018 讲述 rustdoc 代码样本，应在 2018 版 Rust 下编译。同样，您可以指定 edition2015 以 2015 年版编制本规范。

