按照 RFC 1946 的设计，当您将某项用作链接时，Rustdoc 可以解析项的路径。要解析这些类型名称，它通过声明或通过 use ，使用当前在范围内的项。对于模块，“活动范围”取决于文档是否写在模块外部（如 mod 内的 /// 注释）或模块内部（文件或块内的 //! 注释）。对于所有其他项，它使用封闭模块的范围。 例如，在以下代码中： /// Does the thing.
pub fn do_the_thing(_: SomeType) { println!("Let's do the thing!");
} /// Token you use to [`do_the_thing`].
pub struct SomeType; 在 SomeType 的文档有 [`do_the_thing`] 链接，会正确链接到 fn do_the_thing 页面。请注意，在这里，rustdoc 将为您插入链接目标，但手动编写目标也可以： pub mod some_module { /// Token you use to do the thing. pub struct SomeStruct;
} /// Does the thing. 需要一个 [`SomeStruct`] for the thing to work.
///
/// [`SomeStruct`]: some_module::SomeStruct
pub fn do_the_thing(_: some_module::SomeStruct) { println!("Let's do the thing!");
} 有关详细信息，请查看 RFC ，看看 跟踪问题 有关该功能的哪些部分可用的更多信息。
